Output 1: Identify capacity needs assessmentr of SWM service delivery and integrate decentralised community level engagement into the wider SWM system of the country;
Output 2: Document comprehensive analysis of regulatory policies on watse management, the opportunities in the national context, and local situation in the target area;
Output 3: Document the various communities and public-private partnerships opportunities for the management of SW and their modalities;
Output 4: Replicable PPP ISWM model on the ground enhanced through involvement of key partners.

